export default function SideBar() {
  return (
    <div className='p-2' style={{background: '#DCDCDC', borderColor: '#707070'}}>
        <div className='' style={{background: '#A19B9E', border: '1px solid #707070'}}>
            {/* <div className='col-12'> */}
              <ui style={{listStyleType: 'none'}}>
                <li>
                  <div className='col-12 border border-primary'>
                    <a className='col-12 border border-primary' href="" style={{textDecoration: 'none', color: 'black', border: '2px solid #707070'}}>Registration</a>
                  </div>
                </li>           
              </ui>

            {/* </div> */}
            
        </div>
    </div>
    
  )
}
